import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <nav className="navbar">
      <div className="container">
        <div className="navbar-content">
          <Link to="/" className="navbar-logo">
            <img src="/logo.png" alt="YRIF Logo" />
          </Link>

          <button className="navbar-toggle" onClick={toggleMenu}>
            <span></span>
            <span></span>
            <span></span>
          </button>

          <ul className={`navbar-menu ${isMenuOpen ? 'active' : ''}`}>
            <li><a href="#home" onClick={toggleMenu}>Home</a></li>
            <li><a href="#research" onClick={toggleMenu}>Research</a></li>
            <li><a href="#events" onClick={toggleMenu}>Events</a></li>
            <li><a href="#mentorship" onClick={toggleMenu}>Mentorship</a></li>
            <li><a href="#resources" onClick={toggleMenu}>Resources</a></li>
            <li><Link to="/login" className="btn btn-primary">Login</Link></li>
            <li><Link to="/register" className="btn btn-outline">Register</Link></li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
